                  }}
               />
               <Input
                  placeholder="Placeholder"
                  className={classes.input}
                  inputProps={{
                     'aria-label': 'description',
                  }}
               />
            </div>
         </DialogContent>
         <DialogActions>
            <Button autoFocus onClick={modalAdd} color="primary">
               Cancel
            </Button>
            <Button onClick={modalAdd} color="primary">
               Subscribe
            </Button>
         </DialogActions>
      </Dialog>
   )
}

